import React from "react";

const LineIcon = (props) => {
  const iconRef = useRef();
  useEffect(() => {
    const importIcon = async () => {
      try {
        const iconPath = await import(
          `./line_icons/${props.line.toLowerCase()}.svg`
        );
        iconRef.current = iconPath;
      } catch (err) {
        console.log(err);
      }
    };
    importIcon();
  }, [props.line]);
  if (iconRef.current) {
    const Icon = iconRef;
    return <Icon height="25" width="25" />;
  }
};

export default LineIcon;
